import http from "../common-api";

const PostQuestion = (data) => {
    return http.httpdefault().post("/Question", data);
  };
  
const GetQuestionAndPolls = (id, data) => {
  return http.httpdefault().get("/Question/" + id + "/QuestionAndPolls", data);
};

const GetRandomQuestionId = (data) => {
  return http.httpdefault().get("/Question/GetRandomQuestionId", data);
};

export default {
  PostQuestion,
  GetQuestionAndPolls,
  GetRandomQuestionId
};
